        public String recorrido(Nodo raiz){
                String ast = "";
                for(Nodo hijos : raiz.Hijos){
                        //If hijos is null then eliminate
                        if(!(hijos.Etiqueta.equals(""))){
                                if(hijos.pythonCode.equals("")){
                                        ast += recorrido(hijos);
                                }else{
                                        ast += hijos.pythonCode;
                                }
                        } else {
                                System.out.println(raiz.Etiqueta);
                        }
                
                
                }
                return ast;
        }
